import styled from 'styled-components'

export const ListContainer = styled.li`
  width: 100%;

  @media screen and (min-width: 576px) {
    width: 40%;
  }
  @media screen and (min-width: 768px) {
    width: 30%;
  }
`

export const ListImage = styled.img`
  width: 100%;
`
